import React from 'react';

export function Reservation({id, title, days, isPickUp, totalPrice, reservationEnd, bookType}){
    return(
        <div className='reservation-container'>
            <p className='txt res-text'> <strong>Reservation: </strong></p>
            <div className='txt res-info'>
                <p><strong>Title: </strong>{title}
                <strong>Book type: </strong>{bookType}
                <strong>Is quick up: </strong>{isPickUp}
                <strong>Reservation days: </strong>{days}
                <strong>Book return date: </strong>{reservationEnd}
                <strong>Total reservation cost: </strong>{totalPrice}</p>
            </div>
        </div>
    );
}
